"""
Назовем умножением строки на число запись в формате n(string), где n — неотрицательное целое число,
    а string — строка, которая должна быть записана n раз. Раскрытием умножения будем считать развернутый вариант
    данной записи, например, строка ti2(Be)3(Ge) после раскрытия в ней всех умножений будет иметь вид tiBeBeGeGeGe.

Напишите программу, которая раскрывает все умножения в тексте и выводит полученный результат.

Формат входных данных
На вход программе подается одна строка, содержащая строчные латинские буквы, числа и скобки.

Формат выходных данных
Программа должна вывести строку, в которой раскрыты все умножения с учетом приоритетности операций.

Примечание 1. Гарантируется, что умножение в подаваемой строке всегда записано корректно,
                то есть строго в формате n(string). Записи вида 4(2), 3q, (fg)7 не корректны.

Примечание 2. Рассмотрим третий тест. С учетом приоритетности операций сначала раскрываем умножение 2(a)
                и получаем промежуточную строку bbbb10(aa)bbb, далее раскрываем умножение 10(aa) и получаем
                конечный результат в виде строки bbbbaaaaaaaaaaaaaaaaaaaabbb.

Примечание 3. Строка, в которой раскрыты все умножения, всегда содержит исключительно строчные латинские буквы.

Примечание 4. Максимальная длина результирующей строки не превосходит 450000 символов.
"""
from re import sub


def func(text):
    num, text = text.groups()
    return text * int(num)


tests = ["hello3(world)hi", "0(s)he0(be)lie0(ve)d", "bbbb10(2(a))bbb", "hi2(priv3(d3(i)dd)qq)b0(pr)qwqdd", "hhhhhh", "dvor2(tri)ttt2(tri1(vri)t)qqq", "0(d)", "2(a)", "1(a)", "3(a)a", "2(a2(b))", "a2(b3(c4(d5(e6(g7(h))))))", "a2(b3(c4(d5(e6(g7(h8(i)))))))", "a2(b3(c4(d5(e6(g7(h8(i9(j))))))))", "1(a)b11(a)"]
answers = ["helloworldworldworldhi", "helied", "bbbbaaaaaaaaaaaaaaaaaaaabbb", "hiprivdiiidddiiidddiiiddqqprivdiiidddiiidddiiiddqqbqwqdd", "hhhhhh", "dvortritrittttrivrittrivritqqq", "", "aa", "a", "aaaa", "abbabb", "", "", "", "abaaaaaaaaaaa"]

for i in range(len(tests)):
    print(f"\nтест {i + 1}")
    test = tests[i]
    while "(" in test:
        test = sub(r"(\d+)\((\w+)\)", func, test)
    print(f"================={test == answers[i]}=================")
    print(answers[i])
    print(test)
